import React, { useEffect } from 'react';

const YourComponent = () => {
    useEffect(() => {
        const loadReCaptcha = () => {
            const script = document.createElement('script');
            script.src = 'https://www.google.com/recaptcha/api.js';
            script.async = true;
            script.defer = true;
            document.head.appendChild(script);
        };

        loadReCaptcha();

        return () => {
            // Cleanup if needed
            document.head.removeChild(document.head.lastChild);
        };
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        // Add your form submission logic here
    };

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <div className="row mb-3">
                    <label htmlFor="inputEmail3" className="col-sm-2 col-form-label">Email</label>
                    <div className="col-sm-10">
                        <input type="email" className="form-control" id="inputEmail3" />
                    </div>
                </div>
                <div className="row mb-3">
                    <label htmlFor="inputPassword3" className="col-sm-2 col-form-label">Password</label>
                    <div className="col-sm-10">
                        <input type="password" className="form-control" id="inputPassword3" />
                    </div>
                </div>
                <div className="row mb-3">
                    <div className="col-sm-10 offset-sm-2">
                        <div className="form-check">
                            <input className="form-check-input" type="checkbox" id="gridCheck1" />
                            <label className="form-check-label" htmlFor="gridCheck1">
                                Example checkbox
                            </label>
                        </div>
                    </div>
                </div>
                <div data-sitekey="6LeSkxwpAAAAAJr0__9WFMn2k3bJ9EW1eT52aaqm"></div>
                {/* Replace YOUR_SITE_KEY with the site key you obtained from reCAPTCHA registration */}
                <button type="submit" className="btn btn-primary">Sign in</button>
            </form>

            <script type="text/javascript">
                {/* Make sure to include your onloadCallback function here */}
                var onloadCallback = function () {
                    grecaptcha.render('html_element', {
                        'sitekey': '6LcnjRwpAAAAANRDtbBwSwzFA4sKKBWZdT8iZjlp'
                    })
                }
            </script>
        </div>
    );
};

export default YourComponent;
